      "uri" : "https://fellesdatakatalog.brreg.no/api/concepts/9b136d68-a8d0-44ac-93e8-b62b6b0c455d",
      "identifier" : "http://begrepskatalogen/begrep/cf248010-dfe5-11e7-9101-005056821322",
