      "definition" : {
        "text" : {
          "nb" : "fysisk person som oppholder seg i riket i ett eller flere tidsrom som før skattleggingsperioden er omme overskrider minst 183 dager i riket i enhver 12 måneders periode eller 270 dager i enhver 36 månedersperiode"
        },
        "remark" : {
          "nb" : "Regelen om at blir skattepliktig som bosatt ved opphold på mer enn 270 dager i løpet av en hver 36 månedersperiode gjelder ikke for personer bosatt på Svalbard. Dersom personen er skattepliktig som bosatt i Norge forrige skattleggingsperiode videreføres normalt dette også til denne skattleggingsperioden, med mindre han/hun krever opphør av skatteplikten. Det er lovregulert når skatteplikten pga. bosettelse opphører for personer som tar fast opphold i utlandet. Hvis man overstiger grensene for opphold innenfor skattleggingsperioden er man å anse som skattepliktig som bosatt i Norge fra og med den første oppholdsdagen. Strekker antall dager i oppholdsperioden seg over to skattleggingsperioder, anses den skattepliktige å være bosatt i Norge fra og med den 1. januar i den skattleggingsperioden den skattepliktige overstiger 183/270 dager. Om personen oppholder seg mer enn 183 dager i det første året, inntrer skatteplikten som bosatt på ankomstdagen. Personer som er bosatt på fastlandet og tar opphold på Svalbard, vil fortsatt anses som bosatt på fastlandet inntil vedkommende eventuelt flytter til et tredjeland og oppfyller krevene for opphør av skatteplikt ved utflytting, jf. sktl. § 2-1 tredje ledd. Oppholdet på Svalbard likestilles med opphold i utlandet i forhold til disse reglene."
        },
