      "example" : {
        "nb" : "Skattyter tok opphold i Norge fra 27. mai i år 1 og har oppholdt seg her resten av året. Siden han har oppholdt seg i Norge mer enn 183 dager dette året, anses han bosatt i Norge fra 27. mai, jf. sktl. § 2-1 annet ledd. Han har da rett til 8/12 personfradrag.\nSkattyter reiser tilbake til hjemlandet og tar fast opphold der fra 1. april i år 2. Etter dette tidspunkt har skattyter ikke oppholdt seg i Norge og verken han eller hans nærstående disponerer bolig i Norge. Skattyter vil likevel bli ansett som bosatt i Norge i hele år 2, jf. sktl. § 2-1 tredje ledd bokstav a, fordi han har oppholdt seg i Norge mer enn 61 dager. Dermed vil han få personfradrag for hele år 2."
