        "remark" : {
          "nb" : "Fast eiendom i Norge er knyttet til matrikkelen, mens eiendom i utlandet ikke er det. Derfor er det viktig å ha et begrep som rommer all fast eiendom uavhengig av geografisk lokasjon, være seg i Norge eller i utlandet. Utvinnbare naturressurser, for eksempel sand og grus, regnes som en del av den faste eiendommen inntil det blir utgravd og dermed går over til å bli løsøre. Alt som på en naturlig måte er forbundet med eiendommen er en del av denne. Hus og byggverk er bestanddeler av fast eiendom, men det forutsetter en ikke altfor beskjeden fysisk tilknytning, og at det er en viss permanens over bygningene. Campingvogner faller for eksempel utenfor."
