          "nb" : "skattefavorisert individuell pensjonsordning utformet som pensjonsspareavtale nytegnet 1.11.2017 eller senere"
        },
        "remark" : {
          "nb" : "Ordningen erstatter ordingen med individuell pensjonsavtale (IPS), som er stengt for nytegning fra 1.11.2017. De som har en eksisterende IPS-avtale kan fortsette å spare på denne, men maksimalt samordnet årlig inntektsfradrag kan uansett ikke overstige 40 000 kroner for gammel og ny ording. Avtale om individuell sparing til pensjon må være tegnet etter 1.11.2017. Når midlene fra individuell sparing til pensjon kommer til utbetaling skal de beskattes som alminnelig inntekt, men ikke som personinntekt. Årlig inntektsfradrag (og innbetaling) er begrenset oppad til 40 000 kroner per person. Pensjonsavtaler i medhold av loven må gi pensjonssparer rett til alderspensjon, men kan i tillegg omfatte forsikringer som dekker innskuddsfritak ved uførhet. Pensjonskapitalen er bundet fram til 62 år."
        },
