          "nb" : "beløpet som går til fradrag i skattepliktig formue. Som «samlet gjeld» regnes enhver rettslig forpliktelse som påhviler skattyter ved inntektsårets utgang til å yte noe til andre i penger eller pengers verdi. Det er uten betydning om gjelden er rentebærende eller ikke, og hvordan den er oppstått. Det er ikke noe vilkår at skattyter har mottatt krav på beløpet ved inntektsårets utgang, f.eks. i form av regning eller faktura."
