    }, {
      "id" : "bc45c8f6-1994-4e60-8274-2c0efe4b4981",
      "uri" : "https://fellesdatakatalog.brreg.no/api/concepts/bc45c8f6-1994-4e60-8274-2c0efe4b4981",
      "identifier" : "https://nav.no/begrep/Lars_Spesial_3",
      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "en kategori som beskriver behovet til brukere med nedsatt arbeidsevne, som vil kunne komme i arbeid gjennom egeninnsats og en innsats fra NAV eller andre samarbeidende aktører."
        },
        "remark" : {
          "nb" : "\"Spesielt tilpasset innsats tilbys brukere som etter en arbeidsevnevurdering har fått fastslått at arbeidsevnen er nedsatt, samtidig som det legges til grunn at brukeren vil kunne skaffe seg eller beholde arbeid gjennom egeninnsats og en innsats fra NAV eller andre samarbeidende aktører. Det presiseres at det skal legges til grunn en vid tolkning av brukers mulighet til å skaffe seg eller beholde arbeid...]. \n\nUtfallet innebærer at innsatsen fra NAV kan omfatte både aktiviteter og tjenester av både kortere og lengre varighet i tillegg til de generelle tjenestene. NAVs innsats vil ofte skje i kombinasjon med virkemidler fra andre, for eksempel medisinsk behandling og rehabilitering, tilrettelegging, sosial trening eller] oppfølging. Brukeren har rett til å delta i utformingen av en aktivitetsplan, eventuelt et kvalifiseringsprogram.\""
        },
        "source" : {
          "prefLabel" : {
            "nb" : "LOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a; \n\"Spesielt tilpasset innsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 5 - 6. Hentet 6. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a"
          }
        },
        "sources" : [ {
