          "nb" : "skattepliktig utbetaling fra et aksjeselskap til aksjonær på aksjer registrert i verdipapirsentralen (VPS)."
        },
        "remark" : {
          "nb" : "En bestemt andel av overskuddet i et selskap blir bevilget utbetalt som aksjeutbytte. De som eier aksjer når utbyttebetalingene fastsettes (av generalforsamlingen) vil få utbetalt sin andel av aksjeutbyttet basert på hvor mange aksjer du eier i selskapet. En VPS-konto er en konto der verdipapirene er oppbevart. enten det er VPS-registrerte aksjer, fond, egenkapitalbevis, obligasjoner eller sertifikater. Foretar du en handel, vil du etter noen dager motta en endringsmelding fra VPS som viser hvordan din nye portefølje ser ut. VPS fører også oversikt over utbetaling av utbytte."
