      },
      "example" : {
        "nb" : "Fast driftssted kan være et sted der foretaket har sin ledelse, filial, kontor, fabrikk, verksted, bergverk, olje- eller gasskilde, stenbrudd eller ethvert annet sted hvor naturforekomster utvinnes.\nFølgende årsakskoder er knyttet til konklusjonen \"fast driftssted\"\n- fast driftssted etter hovedregelen\n- fast driftssted etter bygg- og monteringsregeelen\n- fast driftssted etter serviceregelen\n- agent\n- selvstendig næringsdrivende vurdert som lønnsmottaker\n- selvstendig næringsdrivende\n- innleie til ikke fast driftssted\n- ikke skatteavtale"
