        "remark" : {
          "nb" : "Personlig skattyter bosatt innenfor EØS-området med begrenset skatteplikt etter sktl. § 2-3, kan på visse vilkår kreve fradrag som om skatteplikten gjaldt all inntekt og formue, jf. sktl. § 6-71. Personer som er skattepliktige etter petroleumsskatteloven kan også kreve fradrag etter sktl. § 6-71 dersom vilkårene for øvrig er oppfylt, se FIN 9. januar 2006 i Utv. 2006/332. Fradragsretten omfatter alle ordinære fradrag.\nFradragsretten omfatter også gjeldsrenter, men vilkårene er noe annerledes enn for ordinære fradrag. Skattyter som krever fradrag for gjeldsrenter, blir skattepliktige for finansinntekter."
